import React, { Component } from "react";

class Testimonials extends Component {
    render() {
        return (
            <div>
                <h1 className="display-4 theme-font">Testimonials</h1>
                <hr />
                <div class="container">
                    <div class="col-sm-12">
                        <img class="img-fluid" src="./assets/image.png" alt=""></img>
                    </div>
                </div>
            </div>
        )
    }
}

export default Testimonials;
